import React, { useEffect, useMemo, useRef, useState } from 'react';

const defaultFrames = [
  '/assets/HearthLoading1.png',
  '/assets/HearthLoading2.png',
  '/assets/HearthLoading3.png',
  '/assets/HearthLoading4.png',
  '/assets/HearthLoading5.png',
  '/assets/Hearthlink.png'
];

export interface HearthlinkLoadingSequenceProps {
  frameDuration?: number;
  finalHoldDuration?: number;
  loop?: boolean;
  onComplete?: () => void;
  message?: string;
  subtext?: string;
  size?: number | string;
  className?: string;
  fullScreen?: boolean;
  frames?: string[];
}

export const HearthlinkLoadingSequence: React.FC<HearthlinkLoadingSequenceProps> = ({
  frameDuration = 200,
  finalHoldDuration = 1000,
  loop = false,
  onComplete,
  message = 'Initializing Hearthlink...',
  subtext,
  size = 220,
  className = '',
  fullScreen = false,
  frames
}) => {
  const sequence = useMemo(() => (frames && frames.length ? frames : defaultFrames), [frames]);
  const [frameIndex, setFrameIndex] = useState(0);
  const hasFiredComplete = useRef(false);

  useEffect(() => {
    setFrameIndex(0);
    hasFiredComplete.current = false;
  }, [sequence]);

  useEffect(() => {
    if (!sequence.length) {
      return;
    }

    const isLastFrame = frameIndex === sequence.length - 1;
    const delay = isLastFrame ? finalHoldDuration : frameDuration;

    const timer = setTimeout(() => {
      if (loop) {
        setFrameIndex(prev => (prev + 1) % sequence.length);
        return;
      }

      if (isLastFrame) {
        if (!hasFiredComplete.current) {
          hasFiredComplete.current = true;
          onComplete?.();
        }
        return;
      }

      setFrameIndex(prev => Math.min(prev + 1, sequence.length - 1));
    }, delay);

    return () => clearTimeout(timer);
  }, [frameIndex, sequence, frameDuration, finalHoldDuration, loop, onComplete]);

  if (!sequence.length) {
    return null;
  }

  const dimension = typeof size === 'number' ? `${size}px` : size;

  return (
    <div
      className={`${fullScreen ? 'fixed inset-0 z-50 flex items-center justify-center bg-slate-950/80 backdrop-blur-xl' : 'flex items-center justify-center'} ${className}`}
      role="status"
      aria-live="polite"
    >
      <div className="relative flex flex-col items-center gap-4 px-6 py-6 text-slate-100">
        <div className="absolute -inset-10 -z-10 bg-[radial-gradient(circle_at_center,rgba(14,165,233,0.18),rgba(15,23,42,0.6)_55%,transparent)] blur-3xl" />
        <div className="absolute -inset-6 -z-10 bg-[conic-gradient(from_120deg,rgba(14,165,233,0.12),rgba(15,23,42,0.4),rgba(14,165,233,0.12))] blur-2xl opacity-80" />

        <div
          className="relative flex items-center justify-center overflow-hidden rounded-full border border-cyan-500/40 bg-slate-900/70 shadow-[0_0_45px_rgba(34,211,238,0.35)] backdrop-blur-md"
          style={{ width: dimension, height: dimension }}
        >
          <div className="absolute inset-0 bg-[radial-gradient(circle_at_center,rgba(14,165,233,0.2),transparent_70%)] pointer-events-none" />
          <div className="absolute inset-0 animate-pulse opacity-50 bg-[conic-gradient(from_0deg,rgba(14,165,233,0.2),rgba(249,115,22,0.05),rgba(14,165,233,0.2))]" />

          <img
            key={sequence[frameIndex]}
            src={sequence[frameIndex]}
            alt="Hearthlink loading"
            className="relative h-[86%] w-[86%] object-contain drop-shadow-[0_0_30px_rgba(6,182,212,0.6)] transition-opacity duration-300"
          />
        </div>

        {(message || subtext) && (
          <div className="text-center space-y-1">
            {message && <p className="text-sm font-semibold tracking-[0.08em] text-cyan-100 sm:text-base">{message}</p>}
            {subtext && <p className="text-xs text-slate-400 sm:text-sm">{subtext}</p>}
          </div>
        )}
      </div>
    </div>
  );
};

